import React, { useState } from 'react';
import DateFnsUtils from '@date-io/date-fns';
import {
  KeyboardDatePicker,
  MuiPickersUtilsProvider,
} from '@material-ui/pickers';

const CustomDatePicker = (props: any) => {
  const [selectedDateFrom, handleDateFromChange] = useState<any>(new Date());
  const [selectedDateTo, handleDateToChange] = useState<any>(new Date());

  return (
    <MuiPickersUtilsProvider utils={DateFnsUtils} style={{ marginBottom: '30px' }}>
      <KeyboardDatePicker
        autoOk
        variant="inline"
        inputVariant="outlined"
        label="With keyboard"
        format="yyyy-MM-dd"
        value={selectedDateFrom}
        InputAdornmentProps={{ position: "start" }}
        onChange={(date: any) => handleDateFromChange(date)}
      />
      <KeyboardDatePicker
        autoOk
        variant="inline"
        inputVariant="outlined"
        label="With keyboard"
        format="yyyy-MM-dd"
        value={selectedDateTo}
        InputAdornmentProps={{ position: "start" }}
        onChange={(date: any) => handleDateToChange(date)}
      />
    </MuiPickersUtilsProvider>
  );
}

export default CustomDatePicker;
